import '../css/Home.css';
import React, { useState, useRef, useEffect } from 'react';
import { Link } from 'react-router-dom';


export default function Home() {
    const [navOpen, setNavOpen] = useState(false);
    const mbNavRef = useRef(null);
    const navOpenRef = useRef(null);
  
    const [loginOpen, setLoginOpen] = useState(false);
    const [signupOpen, setSignupOpen] = useState(false);
  
  
    const handleNavOpen = () => {
      setNavOpen(!navOpen);
      document.body.style.overflow = 'hidden';
    };
    const handleNavClose = () => {
      setNavOpen(false);
      document.body.style.overflow = 'auto';
    };
  
  
    const handleLoginOpen = () => {
      setLoginOpen(true)
  
      console.log(loginOpen)
    };
    const handleLoginClose = () => {
      setLoginOpen(false)
    };
  
  
    const handleSignupOpen = () => {
      setSignupOpen(true)
    };
    const handleSignupClose = () => {
      setSignupOpen(false)
    };
  
      useEffect(() => {
      const handleClickOutside = (event) => {
          const mbNavMain = mbNavRef.current;
          const navOpenMain = navOpenRef.current;
  
          if (!mbNavMain.contains(event.target) && !navOpenMain.contains(event.target)) {
              setNavOpen(!navOpen);
          }
      };
  
      console.log(navOpen);
  
      if (navOpen === true) {
          document.body.addEventListener('click', handleClickOutside);
      }
  
      return () => {
          document.body.removeEventListener('click', handleClickOutside);
      }
      
  }, [navOpen]);




        const [formData, setFormData] = useState({
        first_name: '',
        last_name: '',
        username: '',
        email: '',
        gender: '',
        phone_number: ''
        });
    

        const handleChange = (e) => {
            const { name, value, type, checked } = e.target;
            const newValue = type === 'radio' ? checked : value;
          
            setFormData((prevData) => ({
              ...prevData,
              [name]: newValue,
            }));
          };

        const handleSubmit = (e) => {
            e.preventDefault();
        }

        // Make a POST request to your Django backend using fetch
        fetch('http://your-django-backend/api/sign-up/', {
            method: 'POST',
            headers: {
            'Content-Type': 'application/json',
            },
            body: JSON.stringify(formData),
        })
            .then(response => {
            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            return response.json();
            })
            .then(data => {
            console.log(data);
            // Handle success if needed
            })
            .catch(error => {
            console.error('Error:', error);
            // Handle error if needed
            });

  
    
    return (
      <div>
        <div class="bg-imgs">
          <div class="head">
              <img src= "img/header.png" />
          </div>
          <div class="center">
              <img src= "img/girl-swing.svg" />
          </div>
          <div class="foot">
              <img src= "img/footer.svg" />
          </div>
          <div class="foot-img">
              <img src="img/bot-r.svg" id = "bot-r" />
              <img src="img/bot-l.svg" id = "bot-l" />
          </div>
      </div>
  
        <nav>
            <h1>LOGO CalmSpace</h1>
            <ul>
                <Link to = "/assessment"><li className = "nav-links">Assessments</li></Link>
                <Link to = "/exercise"><li className = "nav-links">Exercises</li></Link>
                <Link to = "/resource"><li className = "nav-links">Resource Hub</li></Link>
                <Link to = "/clinic"><li className = "nav-links">Clinic</li></Link>
                <li id = "login" onClick={handleLoginOpen}>Log In</li>
            </ul>
            <div className="mob-nav" id = "mb-nav-open" ref={navOpenRef} onClick={handleNavOpen}>
                <ion-icon name="menu"></ion-icon>
            </div>
            <div className ="mb-nav-main" id = "mb-nav-main" ref={mbNavRef} style = {{display : navOpen === true ? 'flex' : 'none'}}>
                <div className ="mb-nav-head" id = "mb-nav-close" onClick={handleNavClose}>
                    <ion-icon name ="close"></ion-icon>
                </div>
                <ul>
                    <Link to = "/assesment">
                        <li className = "mb-nav-opt" id = "mb-nav-asses"><ion-icon name="document-text" className = "mb-nav-icon"></ion-icon> Assessments</li>
                    </Link>
                    <Link to = "/assesment">
                        <li className = "mb-nav-opt" id = "mb-nav-exercise"><ion-icon name="barbell" className = "mb-nav-icon"></ion-icon> Exercises</li>
                    </Link>
                    <Link to = "/assesment">
                        <li className = "mb-nav-opt" id = "mb-nav-resource"><ion-icon name="cube" className = "mb-nav-icon"></ion-icon> Resource Hub</li>
                    </Link>
                    <Link to = "/assesment">
                        <li className = "mb-nav-opt" id = "mb-nav-clinic"><ion-icon name="medkit"></ion-icon> Clinic</li>
                    </Link>
                    <a>
                        <li className = "mb-nav-opt" id = "mb-nav-login"><ion-icon name="log-in"></ion-icon> Log in</li>
                    </a>
                </ul>
            </div>
        </nav>
  
        <section className ="main-sec">
          <h1>Providing High Quality <br />Mental Health Care</h1>
          <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. 
              Eius rerum voluptate explicabo hic distinctio deleniti cum, 
              ea ut minus accusamus minima? Quasi quibusdam dignissimos quae 
              rerum explicabo animi incidunt magni!</p>
          <p id = "register" onClick={handleSignupOpen}>Register now</p>
        </section>
  
        <section className = "bg-login" id = "bg-login" style = {{display : loginOpen === false && signupOpen === false ? 'none' : 'flex'}} onClick={() => { handleLoginClose(); handleSignupClose(); }}>
  
        </section>
  
        <div class="login-frm" id= "login-frm" style = {{display : loginOpen === false ? 'none' : 'flex'}}>
          <h2>Login</h2><br />
          <form action="" method="">
              <div class="form-group">
                  <input type="text" id="username" name="username" required placeholder="Username" />
              </div>
              <div class="form-group">
                  <input type="password" id="password" name="password" required placeholder="Password" />
              </div>
              <div class="form-group" id = "form-group-a">
                  <a href="#">Forgot password</a>
                  <a href="#" id = "login-to-signup" onClick={() => { handleLoginClose(); handleSignupOpen(); }}>Sign up</a>
              </div>
              <div class="form-group">
                  <button type="submit">Login</button>
              </div>
          </form>
          <div class="form-close" id = "login-close" onClick={handleLoginClose}>
              <ion-icon name="close"></ion-icon>
          </div>
      </div>
  
        <div className = "signup-frm" id= "signup-frm" style = {{display : signupOpen === false ? 'none' : 'flex'}}>
  
        <h2>Sign Up</h2>
          <form method="POST" onSubmit={handleSubmit}>
  
              <div className ="form-group">
                  <input type="text" id="sgnUp-firstName" name="first_name" value={formData.first_name} required placeholder="First Name" onChange={handleChange}/>
  
                  <input type="text" id="sgnUp-lastName" name="last_name" value={formData.last_name} required placeholder="Last Name" onChange={handleChange}/>
              </div>
  
              <div className ="form-group">
                  <input type="text" id="sgnUp-username" name="username" value={formData.username} required placeholder="Username" onChange={handleChange}/>
              </div>
  
              <div className ="form-group">
                  <input type="email" id="sgnUp-email" name="email" value={formData.email} required placeholder="Email" onChange={handleChange}/>
              </div>
  
              <div className ="form-group">
                  <input type="tel" id="sgnUp-phoneNumber" name="phone_number" value={formData.phone_number} required placeholder="Phone Number" onChange={handleChange}/>
              </div>
  
              <div className ="form-group">
                  <input type="password" id="sgnUp-password" name="password1" value={formData.password1} required placeholder="Password" onChange={handleChange}/>
              </div>
  
              <div className ="form-group">
                  <input type="password" id="sgnUp-confirmPassword" name="password2" value={formData.password2} required placeholder="Confirm Password" onChange={handleChange}/>
              </div>
  
              <div className ="form-group" id="form-group-rad">
                  <label for="gender">Gender</label>
                  <div className ="radio-group">
  
                      <div className ="radio-cont">
                          <input type="radio" id="male" name="gender" value="male" checked={formData.gender === 'Male'} required onChange={handleChange}/>
                          <label for="male">Male</label>
                      </div>
                      
                      <div className ="radio-cont">
                          <input type="radio" id="female" name="gender" value="female" checked={formData.gender === 'Female'} required onChange={handleChange}/>
                          <label for="female">Female</label>
                      </div>
  
                      <div className ="radio-cont">
                          <input type="radio" id="other" name="gender" value="other" checked={formData.gender === 'other'} required onChange={handleChange}/>
                          <label for="other">Other</label>
                      </div>
  
                  </div>
  
              </div>
  
              <div className ="form-group">
                  <button type="submit">Sign Up</button>
              </div>
  
              <div class="form-close" id = "signup-close"  onClick={handleSignupClose}>
                <ion-icon name="close"></ion-icon>
              </div>
          </form>
  
        </div>
      </div>
    );
  }
